import React, { useEffect, useState } from "react";
import { useSearchParams } from "react-router-dom";
import axios from "axios";
import "../styles/ComparisionPage.css";

const InspectionSummary = () => {
    const [searchParams] = useSearchParams();
    const customerId = searchParams.get("customerId");
    const [comparisonResult, setComparisonResult] = useState(null);
    const [error, setError] = useState("");

    useEffect(() => {
        const fetchComparisonResult = async () => {
            if (!customerId) {
                setError("Customer ID is missing.");
                return;
            }

            try {
                const response = await axios.post(
                    `http://localhost:8000/compare-images/`,
                    {
                        base_id: 1, // Replace with your actual base_id
                        customer_id: parseInt(customerId),
                    },
                    {
                        headers: {
                            "Content-Type": "application/json",
                        },
                    }
                );
                setComparisonResult(response.data);
            } catch (err) {
                console.error("Error fetching comparison result:", err);
                setError(err.response?.data?.detail || "Failed to fetch comparison results.");
            }
        };

        fetchComparisonResult();
    }, [customerId]);

    const formatPercentage = (value) => (value * 100).toFixed(0);

    return (
        <div className="inspection-summary-page">
            <h1>Inspection Summary</h1>
            {error && <p className="error">{error}</p>}
            {comparisonResult ? (
                <div className="results-wrapper">
                    <div className="results-section">
                        <h2>Package Assessment</h2>
                        <div className="result-bar">
                            <p><strong>Seal Integrity:</strong></p>
                            <div className="progress-bar">
                                <div
                                    className="progress"
                                    style={{ width: `${formatPercentage(comparisonResult.front_similarity)}%` }}
                                >
                                    {formatPercentage(comparisonResult.front_similarity)}%
                                </div>
                            </div>
                        </div>
                        <div className="result-bar">
                            <p><strong>Surface Condition:</strong></p>
                            <div className="progress-bar">
                                <div
                                    className="progress"
                                    style={{ width: `${formatPercentage(comparisonResult.ssi_front)}%` }}
                                >
                                    {formatPercentage(comparisonResult.ssi_front)}%
                                </div>
                            </div>
                        </div>
                    </div>

                    <div className="results-section">
                        <h2>Product Assessment</h2>
                        <div className="result-bar">
                            <p><strong>Structural Similarity:</strong></p>
                            <div className="progress-bar">
                                <div
                                    className="progress"
                                    style={{ width: `${formatPercentage(comparisonResult.back_similarity)}%` }}
                                >
                                    {formatPercentage(comparisonResult.back_similarity)}%
                                </div>
                            </div>
                        </div>
                        <div className="result-bar">
                            <p><strong>Bio-Stain Index:</strong></p>
                            <div className="progress-bar">
                                <div
                                    className="progress"
                                    style={{ width: `${formatPercentage(comparisonResult.ssi_back)}%` }}
                                >
                                    {formatPercentage(comparisonResult.ssi_back)}%
                                </div>
                            </div>
                        </div>
                    </div>

                    <div className="summary-section">
                        <h2>Overall Assessment</h2>
                        <p><strong>Condition Index:</strong> {formatPercentage(comparisonResult.average_ssi)}%</p>
                        <p><strong>Final Verdict:</strong> {comparisonResult.overall_condition}</p>
                    </div>
                </div>
            ) : (
                !error && <p>Loading results...</p>
            )}
        </div>
    );
};

export default InspectionSummary;
